import React, {useState, useEffect} from 'react';
import { useHistory } from 'react-router-dom';

import '../App.css';
import samplesAPI from "../api/samplesAPI";
import Sample from "./_sample";

const SamplesPage = () => {
  const history = useHistory();
  // default samples to empty array
  const [samples, setSamples] = useState([]);

  useEffect(() => {
    const init = async () => {
      // get samples
      const response = await samplesAPI.getSamples();
      if (!response) return;

      // success
      setSamples(response);
    };

//     init();
  }, []);

  const newSample = () => {
    history.push('/samples/new')
  }

  return (
    <>
      <div class='breadcrumbs'>
        Samples
        <span></span>
        <button onClick={() => newSample()}>New Sample</button>
      </div>

      <div className="flex flex-title">
        <div className="flex-col-1">
          Name
        </div>
        <div className="flex-col-2">
          Description
        </div>
      </div>

      {samples.map((sample) => (
        <Sample sample={sample} />
      ))}
    </>
  );
}

export default SamplesPage;
